import React from "react";
import Header from "./Header";
import Footer from "./Footer";
import Note from "./Note";
import notes from "../notes";

function App() {
  return (
    <div>
      <Header />
      <Footer />
      <dl className="dictionary">
        {notes.map(notesTerm => (
          <Note
            key={notesTerm.key}
            title={notesTerm.title}
            content={notesTerm.content}
             />
        ))}
      </dl>
    </div>
  );
}

export default App;
